DROP SEQUENCE ART_SQ

CREATE SEQUENCE ART_SQ
START WITH 101
INCREMENT BY 1
MAXVALUE 9999
NO CYCLE
NO CACHE

DROP TABLE ART_TBL

CREATE TABLE ART_TBL
(
Product_code VARCHAR(4) PRIMARY KEY,
Art_name VARCHAR(30) not null,
Category VARCHAR(30) not null,
Price VARCHAR(10) CHECK(Price > 0) not null,
Seller VARCHAR(70) not null,
Buyer VARCHAR(70),
Art_status VARCHAR(15) CHECK(Art_status = 'Pending' or Art_status = 'Available' or Art_status = 'Sold') not null,
Art_image Image not null
)

